    public int[] ampdPeaks() {

        long t1 = System.currentTimeMillis();
        System.out.println(System.currentTimeMillis());

        final int n = timeSeries.length;
        final int el = (int) (Math.ceil(n / 2.0) - 1);

        //Get a random matrix
       Matrix mpk = Matrix.random(el, n);
        //Get a random matrix
        Random ran = new Random();
        for(int i = 0; i < el; i++){
            for (int j = 0; j < n; j++){
                // We added one as we need a randome double starting from 1.0 to 2.0
                // and ran.nextDouble generated a number between 0.0 to 1.0
                mpk.set(i,j,ran.nextDouble()+1);
            }
        }

        //Generating LMS of the signal
        for (int k = 1; k <= el; k++) {
            for (int i = k + 1; i < n - k + 1; i++) {
                if (timeSeries[i - 1] > timeSeries[i - k - 1] && timeSeries[i - 1] > timeSeries[i + k - 1]) {
                    mpk.set(k - 1, i - 1, 0);
                }
            }
        }

        // Row wise summation of LMS
        double[] pk_gamma = JamaUtils.rowsum(mpk).getColumnPackedCopy();
        //Find the global minimum in the sum
        double min_pk_gamma = pk_gamma[0];
        int min_pk_gamma_kix = 0;
        for (int kix = 1; kix < el; kix++) {
            if (pk_gamma[kix] < min_pk_gamma) {
                min_pk_gamma = pk_gamma[kix];
                min_pk_gamma_kix = kix;
            }
        }
        int pk_lamb = min_pk_gamma_kix;

        // pick submatrix from LMS matrix
        Matrix mr = mpk.getMatrix(0, pk_lamb - 1, 0, n - 1);

        // Array to hold std results
        ArrayList<Integer> pk_indx = new ArrayList<>();

        // calculate column wise standard deviation of sub matrix mr
        for (int j = 0; j < mr.getColumnDimension(); j++) {
            if (ArrayManupulation.deviation(JamaUtils.getcol(mr, j).getColumnPackedCopy()) == 0) {
                pk_indx.add(j);
            }
        }

        int[] peaks = Ints.toArray(pk_indx);
        System.out.println(System.currentTimeMillis() - t1);

        return peaks;
    }


    public int[] ampdVallies() {
        long t1 = System.currentTimeMillis();
        int n = timeSeries.length;
        int el = (int) (Math.ceil(n / 2.0) - 1);
        Matrix mpk = new Matrix(el, n);
        //Get a random matrix
        Random ran = new Random();
        for(int i = 0; i < el; i++){
            for (int j = 0; j < n; j++){
                mpk.set(i,j,ran.nextDouble()+1);
            }
        }

        //Generating LMS of the signal
        for (int k = 1; k <= el; k++) {
            for (int i = k + 1; i < n - k + 1; i++) {
                if (timeSeries[i - 1] < timeSeries[i - k - 1] && timeSeries[i - 1] < timeSeries[i + k - 1]) {
                    mpk.set(k - 1, i - 1, 0);
                }
            }
        }
        // Row wise summation of LMS
        double[] tr_gamma = JamaUtils.rowsum(mpk).getColumnPackedCopy();

        // Find minimum
        double min_tr_gamma = tr_gamma[0];
        int min_tr_gamma_kix = 0;
        for (int kix = 1; kix < el; kix++) {

            if (tr_gamma[kix] < min_tr_gamma) {
                min_tr_gamma = tr_gamma[kix];
                min_tr_gamma_kix = kix;
            }
        }
        int tr_lamb = min_tr_gamma_kix;
        // pick submatrix from LMS matrix
        Matrix mr = mpk.getMatrix(0, tr_lamb - 1, 0, n - 1);
        ArrayList<Integer> val_indx = new ArrayList<>();

        // calculate column wise standard deviation of sub matrix mr
        for (int j = 0; j < mr.getColumnDimension(); j++) {
            if (ArrayManupulation.deviation(JamaUtils.getcol(mr, j).getColumnPackedCopy()) == 0) {

                val_indx.add(j);
            }
        }

        int[] vallies = Ints.toArray(val_indx);
        mpk = null;
        long t2 = System.currentTimeMillis();
        Log.i("APMD TIME", ""+(t2-t1));
        val_indx.clear();
        return vallies;

    }

